import React from "react";
import styled from 'styled-components';

const HeaderWrapper = styled.div`
    display: flex;
    flex-direction: row;
    margin-top: 16px;
    margin-bottom: 16px;    
    gap: 8px;
    align-items: center;
`;

const ProfilePhoto = styled.img`
    width: 65px;
    height: 65px;   
    border-radius: 100px;
`;

const ProfileInfoWrapper = styled.div`
`;

const ProfileName = styled.div`
    font-size: 24px;
    font-weight: bold;
`;

const ProfileSocialRow = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    margin-top: 8px;    
`;

const ProfileSocialMetric = styled.div`
    font-size: 10px;
    font-weight: bold;
    color: #0F18F0;
`;

export default function Header() {
    return (
        <HeaderWrapper>
            <ProfilePhoto
                src="https://res.cloudinary.com/stephenavocado/image/upload/v1651170060/me_sqg5rb.jpg" 
            />
            <ProfileInfoWrapper>
                <ProfileName>stephen_avocado</ProfileName>
                <ProfileSocialRow>
                    <ProfileSocialMetric>0 followers</ProfileSocialMetric>
                    <ProfileSocialMetric>0 following</ProfileSocialMetric>
                    <ProfileSocialMetric>0 pending</ProfileSocialMetric>                    
                </ProfileSocialRow>
            </ProfileInfoWrapper>            
        </HeaderWrapper>
    );
};
